// EntryBox.js
import React, { useState } from 'react';
import axios from 'axios';

function EntryBox() {
  const [inputValue, setInputValue] = useState('');
  const [responseData, setResponseData] = useState('');

  const handleChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:5000/endpoint', { input: inputValue });
      setResponseData(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <input type="text" value={inputValue} onChange={handleChange} placeholder="Enter text" />
        <button type="submit">Submit</button>
      </form>
      {responseData && <div>Response from server: {responseData}</div>}
    </div>
  );
}

export default EntryBox;
